import './projets.css'
import { Col, } from 'react-bootstrap';
import { ProjectCard } from './ProjectCard';
import bg from "img/bg.jpg";

function Projets() {
  const projets = [
  {
    title: "Minishell2",
    description: "Reproduction d'un shell",
    imgUrl : projImg1,
  },
  {
    title: "MyRPG",
    description: "",
    imgUrl : projImg2,
  },
  {
    title: "Need4Stek",
    description: "",
    imgUrl : projImg3,
  }
  ];
  return (
    <section id="projets">
      <Container>
        <Row>
          <Col>
            <h2>Projets</h2>
            <p>Voici quelques projets réalisés durant l'année</p>
            <Tab.Container id="projets-tabs" defaultActiveKey="first">
              <Nav variant="pills" defaultActiveKey="/home">
                <Nav.Item>
                  <Nav.Link eventKey="first">Tab One</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Nav.Link eventKey="second">Tab Two</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Nav.Link eventKey="third" disabled>
                    Tab Three
                  </Nav.Link>
                 </Nav.Item>
              </Nav> 
              <Tab.Content>
                <Tab.Pane eventKey="first">
                  <Row>
                    {
                      projets.map((project, index) => {
                        return (
                          <ProjectCard
                            key={index}
                            {...project}
                          />
                        )
                      })
                    }
                  </Row>
                </Tab.Pane>
                <Tab.Pane eventKey="second">Second</Tab.Pane>
                <Tab.Pane eventKey="third">Third</Tab.Pane>
              </Tab.Content>
            </Tab.Container>
          </Col>
        </Row>
      </Container>
      <img className="background-image-right" src="'{bg}'"></img>
    </section>

  );
}

export default Projets;
